const errorMessages = {
    
    MANDATORY_USERNAME: '* Username required',
    NETWORK_ERROR: 'There was a problem connecting to your network, please try again!!',
    MANDATORY_LOGIN: 'Please login to chat ',
    DEFAULT: 'Oops! Something went wrong, please try again later!!',
    UNAUTHORIZED_ACCESS: 'Unauthorized user. Please enter valid username!',
    MANDATORY_MESSAGE: '* Please enter a message',
  };
  
  export default errorMessages;
